import React, { useContext } from 'react';
import StarWarContext from '../context/StarWarContext';

export default function Table() {

  return (
    <table>
      <thead>
        <tr>
          <td>Nome</td>
          <td>Espécie</td>
          <td>Gênero</td>
          <td>Status</td>
          <td>QUantidade de Episódios</td>
        </tr>
      </thead>
      <tbody />
    </table>
  );
}
